import React from 'react'

export default function Home() {
  return (
    <Stack direction='column' spacing = '60px' margin='250px' marginTop='10px'>
      <Heading>Log In / Sign Up</Heading>
        <Stack direction='row' spacing="300px">
        <SignIn />
        <SignUp />
        </Stack>
    </Stack>
  )
}
